    public static void main(String[] args) throws Exception {
    	
        if (args.length < 1) {
            System.err.println("Use:");
            System.err.println("  XLSX2CSV <xlsx file path> ");
            return;
        }
        
        
        String _prefixschema = null, _directory = null,_productline = null;
        String[] arrpath = null;
        
        System.out.println(args[1]);
    	final File folder = new File(args[1]);
    	String temp = args[1];

    	arrpath = temp.split("//");
    	
    	_productline = arrpath[arrpath.length - 2];
    	System.out.println("Product Line "+_productline);
    	temp = temp.substring(temp.lastIndexOf("//")+2, temp.length() );
    	String _tableprefix = temp;
    	//System.out.println(_tableprefix);
    	_directory = _tableprefix;
    	
    	String _filename = null;
    	
        for (final File fileEntry : folder.listFiles()) {
   
                //System.out.println(fileEntry.getName());
                _filename = fileEntry.getName();
                int dot = _filename.lastIndexOf('.');
                String base = (dot == -1) ? _filename : _filename.substring(0, dot);
                String extension = (dot == -1) ? "" : _filename.substring(dot+1);

                
                if(extension.equals("xlsx"))
                {  
                    File xlsxFile = new File(folder.getAbsolutePath()+"//"+_filename);
                    if (!xlsxFile.exists()) {
                        System.err.println("Not found or not a file: " + xlsxFile.getPath());
                        return;
                    }

                    int minColumns = -1;
                    // The package open is instantaneous, as it should be.
                    OPCPackage p = OPCPackage.open(xlsxFile.getPath(), PackageAccess.READ);
            		Stats22092017 xlsx2csv = new Stats22092017(p,  minColumns);
                	_prefixschema = xlsx2csv.getTablePrefix(_tableprefix,base);
            		xlsx2csv.process(_prefixschema,extension,_directory,_productline);
            		p.close();
                }
                else if(extension.equals("csv"))
                {
                	FileUtils.copyFile(new File(folder.getAbsolutePath()+"//"+_filename), new File("C://output//"+_filename));
                   	File xlsxFile = new File(folder.getAbsolutePath()+"//"+_filename);
                    if (!xlsxFile.exists()) {
                        System.err.println("Not found or not a file: " + xlsxFile.getPath());
                        return;
                    }

                    int minColumns = -1;
                    // The package open is instantaneous, as it should be.
                    OPCPackage p = null ;
            		Stats22092017 xlsx2csv = new Stats22092017(p,  minColumns);
            		_prefixschema = xlsx2csv.getTablePrefix(_tableprefix,base);
            		xlsx2csv.createSchema(_prefixschema,base,extension,_directory,_productline);
                }

        }
        
	

	}
